;; **
;;; # 4. Rule application
;;; Applying a rule to a graph is as simple as calling a function with the rule's name with the graph as an argument. Note that this will produce a new graph (if the rule is applicable). (Graphs are immutable in @@GrapeVine@@, so `g0` will always remain an empty graph.)
;; **

;; @@
(hello g0)
;; @@
;; =>
;;; {"type":"list-like","open":"<span class='clj-list'>(</span>","close":"<span class='clj-list'>)</span>","separator":" ","items":[{"type":"html","content":"<span class='clj-string'>&quot;172822cc-a015-434e-a2dd-a1f60db2ec04&quot;</span>","value":"\"172822cc-a015-434e-a2dd-a1f60db2ec04\""}],"value":"(\"172822cc-a015-434e-a2dd-a1f60db2ec04\")"}
