;; **
;;; The above (homomorphic) matching semantics is the default. However, matching multiple nodes in a rule to a single node in the graph may not be desirable in some appliations. In this case, the rule designer can specify the rule to enforce **_isomorphic_** matching. The following rule `rel2` is identical to the above rule `rel`, except that it requires _isomorphic_ matches.
;; **

;; @@
(rule rel2 [] 
   (read :iso
       (node h:Hello)
       (node h2:Hello))
   (create 
       (edge :rel h h2)))
;; @@
;; =>
;;; {"type":"html","content":"<img src=\"data:image/png;base64,\" width=\"227\" height=\"251\" alt=\"\" />","value":"#object[java.awt.image.BufferedImage 0x5cc3c9f8 \"BufferedImage@5cc3c9f8: type = 6 ColorModel: #pixelBits = 32 numComponents = 4 color space = java.awt.color.ICC_ColorSpace@595c70ef transparency = 3 has alpha = true isAlphaPre = false ByteInterleavedRaster: width = 227 height = 251 #numDataElements 4 dataOff[0] = 3\"]"}
