;; =>
;;; {"type":"list-like","open":"<span class='clj-lazy-seq'>(</span>","close":"<span class='clj-lazy-seq'>)</span>","separator":" ","items":[{"type":"html","content":"<span class='clj-string'>&quot;c50bb89f-12c9-46ef-935c-fa070164f55b&quot;</span>","value":"\"c50bb89f-12c9-46ef-935c-fa070164f55b\""},{"type":"html","content":"<span class='clj-string'>&quot;9dfba4dc-0e4f-4b5e-bcc6-52355818b130&quot;</span>","value":"\"9dfba4dc-0e4f-4b5e-bcc6-52355818b130\""}],"value":"(\"c50bb89f-12c9-46ef-935c-fa070164f55b\" \"9dfba4dc-0e4f-4b5e-bcc6-52355818b130\")"}
