;; **
;;; # 5. History Graphs, Traces and Derivations
;;; 
;;; As explained above, rules are applied to graphs (in @@grapes@@) and are used to _derive_ new graphs. This history of __derivations__ of graphs can themselves be represented as a graph, where the nodes represent graphs and edges represent _occurrences_ of graph transformations (i.e., rule applications).
;;; 
;;; ## 5.1 History Graph
;;; 
;;; We define the __history graph__ of a given graph _g_ as the graph that contains all graphs (and derivations) that _g_ depends on or that depend on _g_. 
;;; 
;;; The above definition can easily be extended to @@grapes@@: Since computations with @@grapes@@ always start with a @@grape@@ that contains a single graph only, the history graph of a @@grape@@ is defined as the history graph of the unique original start graph that all graphs in the @@grape@@ depend on.
;;; 
;;; We can generate the _history graph_ of a @@grape@@ using the `history` function:
;; **

;; @@
(def h (-> (newgrape) hello hello world* vine history))
;; @@
;; =>
;;; {"type":"html","content":"<span class='clj-var'>#&#x27;tutorial/h</span>","value":"#'tutorial/h"}
;; <=

;; **
;;; A history graph is just a regular graph and can be operated on accordingly. For example, we can view the history graph we just created using the view function.
;; **

;; @@
(view h)
;; @@
;; =>
;;; {"type":"list-like","open":"<span class='clj-lazy-seq'>(</span>","close":"<span class='clj-lazy-seq'>)</span>","separator":" ","items":[{"type":"html","content":"<img src=\"data:image/png;base64,\" width=\"804\" height=\"669\" alt=\"\" />","value":"#object[java.awt.image.BufferedImage 0x16c3c6f4 \"BufferedImage@16c3c6f4: type = 5 ColorModel: #pixelBits = 24 numComponents = 3 color space = java.awt.color.ICC_ColorSpace@595c70ef transparency = 1 has alpha = false isAlphaPre = false ByteInterleavedRaster: width = 804 height = 669 #numDataElements 3 dataOff[0] = 2\"]"}],"value":"(#gorilla_repl.image.ImageView{:image #object[java.awt.image.BufferedImage 0x16c3c6f4 \"BufferedImage@16c3c6f4: type = 5 ColorModel: #pixelBits = 24 numComponents = 3 color space = java.awt.color.ICC_ColorSpace@595c70ef transparency = 1 has alpha = false isAlphaPre = false ByteInterleavedRaster: width = 804 height = 669 #numDataElements 3 dataOff[0] = 2\"], :alt \"\", :type \"png\", :width 804, :height 669})"}
