;; =>
;;; {"type":"list-like","open":"<span class='clj-lazy-seq'>(</span>","close":"<span class='clj-lazy-seq'>)</span>","separator":" ","items":[{"type":"html","content":"<span class='clj-string'>&quot;f8f841b4-b2d9-4578-a859-55c1820e30a7&quot;</span>","value":"\"f8f841b4-b2d9-4578-a859-55c1820e30a7\""}],"value":"(\"f8f841b4-b2d9-4578-a859-55c1820e30a7\")"}
;; <=

;; **
;;; We we see above that the empty graph satisfies this negated constraint.
