;; **
;;; ## 6.4 Constraint clauses
;;; 
;;; In mathematical logic, a _clause_ is a formula of the form @@L_1 \vee ... \vee L_n@@, where each @@L_i@@ is a positive or negative literal. 
;;; 
;;; @@GrapeVine@@ provides the `constraint-clause` form for defining constraints in clausal form, where each literal is a positive or negative atomic constraint. For example, the form below defines a constraint claus (named `self-or-not-hello-to-grape!`) as a disjunction of the two atomic constraints `self-related!` and `if-hello-then-to-grape!`).
;; **

;; @@
(constraint-clause  self-or-not-hello-to-grape! 
                    [self-related! if-hello-then-to-grape!])
;; @@
;; =>
;;; {"type":"html","content":"<span class='clj-var'>#&#x27;tutorial/self-or-not-hello-to-grape!</span>","value":"#'tutorial/self-or-not-hello-to-grape!"}
;; <=

;; **
;;; Constraints defined in clausal form can be applied to Grapes in the same way as atomic constraints, except that their negation is not defined. See below for an example.
;; **

;; @@
(-> (newgrape) hello world vine self-or-not-hello-to-grape!)
;; @@
;; =>
;;; {"type":"list-like","open":"<span class='clj-lazy-seq'>(</span>","close":"<span class='clj-lazy-seq'>)</span>","separator":" ","items":[{"type":"html","content":"<span class='clj-string'>&quot;49590265-4add-4fb9-93fa-c120b79bef53&quot;</span>","value":"\"49590265-4add-4fb9-93fa-c120b79bef53\""}],"value":"(\"49590265-4add-4fb9-93fa-c120b79bef53\")"}
;; <=

;; **
;;; # 7. Invariants
;;; 
;;; Above we have seen how constraints can be checked and enforced manually. Constraints can also be attached to graphs as _invariants_.
;;; 
;;; The definition of invariants can have one of two modes:
;;; 
;;; 1. **enforced** invariants are guaranteed by disallowing any graph in the graph process that does not satisfy the invariant. (_This is mainly useful for restricting the behaviour of rules._)
;;; 
;;; 1. **asserted** invariants are checked upon each occurrence in the graph process and violations are reported through exceptions. (_This is mainly useful for model checking._)
;;; 
;;; ## 7.1 Enforced invariants
;;; 
;;; As an example, let's assume we want to allow only one single `to` edge from a `Hello` node. We can define the following constraint (and then use its negation as an enforced invariant on a graph).
;; **

;; @@
(constraint multiple-to! 
       (node h:Hello)
       (node n1)
       (node n2)
       (edge :to h n1)
       (edge :to h n2))
;; @@
;; =>
;;; {"type":"html","content":"<img src=\"data:image/png;base64,\" width=\"227\" height=\"251\" alt=\"\" />","value":"#object[java.awt.image.BufferedImage 0x256277b4 \"BufferedImage@256277b4: type = 6 ColorModel: #pixelBits = 32 numComponents = 4 color space = java.awt.color.ICC_ColorSpace@e72b04d transparency = 3 has alpha = true isAlphaPre = false ByteInterleavedRaster: width = 227 height = 251 #numDataElements 4 dataOff[0] = 3\"]"}
;; <=

;; **
;;; We can now create a graph where the negation of this constraint is an enforced invariant.
;; **

;; @@
(def g (-> (newgrape) (enforce-invariant multiple-to!-)))
;; @@
;; =>
;;; {"type":"html","content":"<span class='clj-var'>#&#x27;tutorial/g</span>","value":"#'tutorial/g"}
;; <=

;; **
;;; Let's try to apply two times the `world` rule: 
;; **

;; @@
(-> g hello world world)
;; @@
;; =>
;;; {"type":"list-like","open":"<span class='clj-lazy-seq'>(</span>","close":"<span class='clj-lazy-seq'>)</span>","separator":" ","items":[],"value":"()"}
;; <=

;; **
;;; As we can see above, there is no result (i.e., the enforced invariant has prevented the second application of `world`).
;;; 
;;; In comparison, let's do the same on a graph that does not have the enforced invariant. The example below shows that without the enforced invariant, the operation succeeds.
;;; 
;; **

;; @@
(-> (newgrape) hello world world view)
;; @@
;; =>
;;; {"type":"list-like","open":"<span class='clj-lazy-seq'>(</span>","close":"<span class='clj-lazy-seq'>)</span>","separator":" ","items":[{"type":"html","content":"<img src=\"data:image/png;base64,\" width=\"429\" height=\"251\" alt=\"\" />","value":"#object[java.awt.image.BufferedImage 0x41eb95fe \"BufferedImage@41eb95fe: type = 6 ColorModel: #pixelBits = 32 numComponents = 4 color space = java.awt.color.ICC_ColorSpace@e72b04d transparency = 3 has alpha = true isAlphaPre = false ByteInterleavedRaster: width = 429 height = 251 #numDataElements 4 dataOff[0] = 3\"]"}],"value":"(#gorilla_repl.image.ImageView{:image #object[java.awt.image.BufferedImage 0x41eb95fe \"BufferedImage@41eb95fe: type = 6 ColorModel: #pixelBits = 32 numComponents = 4 color space = java.awt.color.ICC_ColorSpace@e72b04d transparency = 3 has alpha = true isAlphaPre = false ByteInterleavedRaster: width = 429 height = 251 #numDataElements 4 dataOff[0] = 3\"], :alt \"\", :type \"png\", :width 429, :height 251})"}
;; <=

;; **
;;; ## 7.2 Asserted invariants
;;; In contrast the _enforced_ invariants, _asserted_ invariants are monitored but not enforced. Occurrences that violated asserted invariants are reported as exceptions. Lets consider the same example, but this time wiht an asserted invariant:
;; **

;; @@
(def g (-> (newgrape) (assert-invariant multiple-to!-)))

;; @@
;; =>
;;; {"type":"html","content":"<span class='clj-var'>#&#x27;tutorial/g</span>","value":"#'tutorial/g"}
;; <=

;; **
;;; Let's cause a violation of the assertion:
;; **

;; @@
(-> g hello world world)
;; @@

;; **
;;; # 8. Graph Queries
;;; 
;;; Graph queries are used to extract data from a graph (for further processing in the host language Clojjure) and to visualize parts of interest.
;;; 
;;; By convention and to distinguish queries from rules and constraints, names of queries should be appended with a question mark (**?**).
;;; 
;;; Like rules and constraints, queries can be applied to @@grapes@@, but they return a relation for each graph in the @@grape@@.
;;; 
;;; Consider the following query as an example:
;; **

;; @@
(query hello-to? []
     (node h:Hello)
     (node x)
     (edge :to h x))
