;; **
;;; # 10. Control structures
;;; 
;;; Control structures are the primitives we use to control the application of graph transformations, i.e., to write _graph programs_. 
;;; Since @@GrapeVine@@ is embedded into the Clojure, all the regular Clojure control structures are available to program with graph transformations. The @@GrapeVine@@ approach is to leverage these existing control structures as much as possible rather than introducing new "syntactic sugar".
;;; 
;;; We have already seen that we use simple function calls for invoking graph transformations. Calling a rule. We have also seen that the Clojure _threading macro_ (->) is well-suited for _sequential composition_ of graph transformations, tests and queries. Of course, we could always alternative Clojure notation (as we did before as well), e.g, we could use the classical way of nesting function calls (i.e., (f1 (f2)))
;;; 
;;; The following table provides an overview of the typical @@GrapeVine@@ control structures:
;;; 
;;; | Operation  | @@GrapeVine@@ construct  |  Comments  |
;;; |:---:|:---:|:---:|
;;; | __transformation__ with @@r@@ (non-deterministic) | `r`  | or `(r ..)` if rule has parameters  |
;;; |transformation with rule @@r@@ (deterministic)| `r*` | or `r*(..)` if rule has parameters|
;;; | __distinct__ - remove all duplicate graphs | `distinct` | |
;;; | __selection__ of graphs that satisfy constraint @@c@@  | `c`  |  |
;;; | selection of graphs that satisfy constraint @@\neg c@@  | `c-`  |  |
;;; | __constrain__ graphs with invariants @@c1, .., Cn@@ | `(enforce-invariant [c1, .., cn])` | transformations that would violate invariants are disallowed |
;;; | __assert__ invariants @@c1, .., cn@@ | `(assert-invariant [c1, .., cn])` | invariants are monitored and violations reported |
;;; | __unconstrain__ - remove an invariants @@c1, .., Cn@@ from graphs | `(remove-invariant [c1, .., cn])` | |
;;; | __sequence__ of operations @@o1,..on@@ | `(-> o1 .. on)` |  all alternatives are explored concurrently|
;;; | __alternative__ of operations @@o1,..on@@ | `(`<code>&#124;&#124;</code>`o1 .. on)` |  |
;;; | __loop__ of operations @@o1,..on@@ until a graph is found that satisfies constraint @@c@@ - or until no further progress is possible| `(->* c o1 .. on)`  | filters out duplicate graphs (using the _distinct_)|
;;; | __loop!__ of operations @@o1,..on@@ until a graph is found that satisfies constraint @@c@@ - or until no further progress is possible| `(->*! c o1 .. on)`  | no restriction when exploring similar graphs |
;;; 
;;; 
;;; # 10.1 An example
;;; 
;;; Consider the well-known [Wolf-Goat-Cabbage (well, Wolf-Goat-Grape problem)](https://en.wikipedia.org/wiki/Wolf,_goat_and_cabbage_problem) as an example.
;;; 
;;; ![](https://www.mathworks.com/matlabcentral/mlc-downloads/downloads/submissions/55054/versions/1/screenshot.gif)
;;; 
;;; Below is specification of the problem. Rule `setup-ferryman` creates the starting situation. The ferryman can either take one item to the other side  (rule `ferry_one_over`) or he can cross without cargo (rule `cross_empty`). 
;;; 
;;; Then we have defined three graph queries. Two queries for testing the dangerious situations (wolf can eat goat or goat can eat grape) and one test to check whether we have solved the ridle (all on the other side).
;; **

;; @@
(list 
 
(rule setup-ferryman []
  (create
    (node tg:Thing {:kind "'Goat'"})
    (node tc:Thing {:kind "'Grape'"})
    (node tw:Thing {:kind "'Wolf'"})
    (node s1:Side {:name "'This side'"})
    (node s2:Side {:name "'Other side'"})
    (node f:Ferry)
    (edge :is_at tg s1)
    (edge :is_at tc s1)
    (edge :is_at tw s1)
    (edge :is_at f s1)
    ))

(rule ferry_one_over []
  (read :iso
    (node s1:Side)
    (node s2:Side)
    (node f:Ferry)
    (node t:Thing)
    (edge et:is_at t s1)
    (edge e:is_at f s1))
  (delete e et)
  (create
    (edge :is_at f s2)
    (edge :is_at t s2)))

(rule cross_empty []
  (read :iso
    (node s1:Side)
    (node s2:Side)
    (node f:Ferry)
    (edge e:is_at f s1))
  (delete e)
  (create
    (edge :is_at f s2)))

(constraint wolf-can-eat-goat! 
           (node t1:Thing {:kind "'Wolf'"})
           (node t2:Thing {:kind "'Goat'"})
           (node s:Side)
           (node s2:Side)
           (edge :is_at t1 s)
           (edge :is_at t2 s)
           (node f:Ferry)
           (edge :is_at f s2))

(constraint goat-can-eat-grape! 
           (node t1:Thing {:kind "'Grape'"})
           (node t2:Thing {:kind "'Goat'"})
           (node s:Side)
           (node s2:Side)
           (edge :is_at t1 s)
           (edge :is_at t2 s)
           (node f:Ferry)
           (edge :is_at f s2))

(constraint all_on_the_other_side! 
           (node tg:Thing {:kind "'Goat'"})
           (node tc:Thing {:kind "'Grape'"})
           (node tw:Thing {:kind "'Wolf'"})
           (node s2:Side {:name "'Other side'"})
           (edge :is_at tg s2)
           (edge :is_at tc s2)
           (edge :is_at tw s2))
)

