;; **
;;; Below is a program that demonstrates the use of the above control structures to solve the ferryman problem:
;;; 
;;; We begin as usual with creating our start graph (grape) (line 1). 
;;; 
;;; Line 2 uses are new **looping** macro. It first takes a constraint to check whether the goal has already reached for _some_ graph in the @@grape@@. If no graph in the @@grape@@ satisfies the constraint, the loop continues. (In other words, the looping macro has an "until" semantics.).
;;; 
;;; Line 3 explores all possible ferry moves in parallel. 
;;; 
;;; Finally, the (negative) constraint checks in lines 3 and 4 filter out the dangerous situations.
;; **

;; @@
(-> (newgrape) setup-ferryman
    (->* all_on_the_other_side!
         (|| ferry_one_over* cross_empty*)
         wolf-can-eat-goat!-
         goat-can-eat-grape!-))
