;;; 
;; **

;; @@
(-> (newgrape) 
  (enforce-invariant wolf-can-eat-goat!- goat-can-eat-grape!-) 
  setup-ferryman
  (->* all_on_the_other_side! (|| ferry_one_over* cross_empty*)))
