;; **
;;; ## 11.2 Negative Application Conditions (NACs)
;;; 
;;; Sometimes we want to prevent the application of rules in contexts that meet certain conditions. This can be done by specifying so-called _Negative Application Conditions (NACs)_ for that rule. Consider our simple example below. Rule `world` should extend a `Hello` node with a new node `World` (and a `to` edge) only if such a node does not already exist. NACs are defined within the `read` part of the rule with the `NAC` form, as shown below.
;; **

;; @@
(list
 
(rule hello []
   (create 
     (node :Hello)))

(rule world []
   (read 
      (node h:Hello)
      (NAC 
       (node wn:World)
       (edge :to h wn )
       ))
   (create 
      (node w:World)
      (edge :to h w )))
 )
